<div id="signup-page-content" class="center">

<legend id="page-title" class="form-section">
创建您的商户帐户
</legend>

<div id="signup-form">
<div id="user-info" class="form-horizontal form-section">
<div class="section-title">帐户信息</div>

<div class="control-group">
<label class="control-label" for="first_name">
名字</label>
<div class="controls input-append">
<input
type="text"
id="first_name"
class="input-block-level"
placeholder="示例：Joe" />
<span class="add-on"><i class="icon-pencil"></i></span>
</div>
</div>
<div class="control-group">
<label class="control-label" for="last_name">姓氏</label>
<div class="controls input-append">
<input
type="text"
id="last_name"
class="input-block-level"
placeholder="示例：Swanson" />
<span class="add-on"><i class="icon-pencil"></i></span>
</div>
</div>

<div class="control-group">
<label class="control-label" for="email">邮箱地址</label>
<div class="controls input-append">
<input
type="text"
id="email"
class="input-block-level"
placeholder="示例：merchant@example.com"
/>
<span class="add-on"><i class="icon-pencil"></i></span>
</div>
</div>
<div class="control-group">
<label class="control-label" for="username">用户名</label>
<div class="controls input-append">
<input
type="text"
id="username"
class="input-block-level"
placeholder="输入用户名" />
<span class="add-on"><i class="icon-pencil"></i></span>
</div>
</div>
<div class="control-group">
<label class="control-label" for="password">密码</label>
<div class="controls input-append">
<input
type="password"
id="password"
class="input-block-level"
placeholder="输入密码" />
<span class="add-on"><i class="icon-pencil"></i></span>
</div>
</div>
<div class="control-group">
<label class="control-label" for="confirm_password">确认密码</label>
<div class="controls input-append">
<input
type="password"
id="confirm_password"
class="input-block-level"
placeholder="再次输入密码" />
<span class="add-on"><i class="icon-pencil"></i></span>
</div>
</div>
</div>
<div id="merchant-info" class="form-horizontal form-section">
<div class="section-title">商户信息</div>
<div class="control-group">
<label class="control-label" for="display_name">公司名称</label>
<div class="controls input-append">
<input
type="text"
id="display_name"
class="input-block-level"
placeholder="示例：Widget Maker International" />
<span class="add-on"><i class="icon-pencil"></i></span>
</div>
</div>
<div class="control-group">
<label class="control-label" for="phone_number_country">电话号码</label>
<div class="controls input-append multi-input">
+
<input
type="text"
id="phone_number_country"
class="input-block-level round-corner"
placeholder="国家" />
-
<input
type="text"
id="phone_number_area"
class="input-block-level round-corner optional"
placeholder="区域" />
-
<input
type="text"
id="phone_number_number"
class="input-block-level"
placeholder="号码" /><span class="add-on"><i class="icon-pencil"></i></span>
</div>
<div class="controls">
Ex. + 1 - 234 - 5678910
<br/>
Ex. + 86 - - 13912345678
<br/>
Ex. + 86 - 21 - 65142545
</div>
</div>

<div class="control-group">
<label class="control-label" for="store_platform">
店铺平台
<i
rel="tooltip"
title="您开店的平台"
class="icon-question-sign"
></i>
</label>
<div class="controls input-append">
<select id="store_platform" class="input-block-level">
<option value>选择一个</option>


<option value="8">Aliexpress</option>



<option value="3">Amazon</option>



<option value="2">Ebay</option>



<option value="1">Etsy</option>



<option value="7">Jd</option>





<option value="9">Shopify</option>



<option value="4">Storenvy</option>



<option value="6">Taobao</option>



<option value="5">Tmall</option>


<option value="0">其他</option>
</select>
<span class="add-on"><i class="icon-pencil"></i></span>
</div>
</div>
<div class="control-group">
<label class="control-label" for="store_url">
店铺 URL
<i
rel="tooltip"
title="填写您的网站链接或您在Ebay/Amazon/Etsy等平台的店铺链接"
class="icon-question-sign"
></i>
</label>
<div class="controls input-append">
<input
type="text"
id="store_url"
class="input-block-level"
placeholder="示例：http://www.widget-maker.com">
<span class="add-on"><i class="icon-pencil"></i></span>
</div>
</div>
<div class="control-group">
<label class="control-label" for="warehouse_locations_country">
库存地点
<i
rel="tooltip"
title="列出您库存的仓库地点"
class="icon-question-sign"
></i>
</label>
<div class="controls input-append">
<select id="warehouse_locations_country" class="input-block-level round-corner">
<option value>选择一个</option>



<option>Argentina</option>




<option>Australia</option>




<option>Austria</option>




<option>Belarus</option>




<option>Belgium</option>




<option>Brazil</option>




<option>Bulgaria</option>




<option>Canada</option>




<option>Chile</option>




<option>China</option>




<option>Colombia</option>




