<option>Vietnam</option>


</select>
<input
type="text"
id="warehouse_locations_region"
class="input-block-level optional"
placeholder="州/省/地区">
<span class="add-on"><i class="icon-pencil"></i></span>
</div>
</div>

<div id="product_categories" class="control-group">
<label class="control-label">
产品类别
<i
rel="tooltip"
title="选择要在 Wish 上销售的产品类别"
class="icon-question-sign"
></i>
</label>
<div class="controls input-append">

<label class="checkbox pull-left ">
<input type="checkbox" name="product_categories" value="Men's Clothing"> 男装
</label>

<label class="checkbox pull-left ">
<input type="checkbox" name="product_categories" value="Bags"> 包
</label>

<label class="checkbox pull-left ">
<input type="checkbox" name="product_categories" value="Kids, Baby &amp; Toys"> 儿童、婴儿用品与玩具
</label>

<label class="checkbox pull-left ">
<input type="checkbox" name="product_categories" value="Cell Phone Accessories"> 手机配件
</label>

<label class="checkbox pull-left ">
<input type="checkbox" name="product_categories" value="Women's Clothing"> 女装
</label>

<label class="checkbox pull-left ">
<input type="checkbox" name="product_categories" value="Shoes"> 鞋类
</label>

<label class="checkbox pull-left ">
<input type="checkbox" name="product_categories" value="Jewelry, Watches &amp; Accessories"> 珠宝、手表与配饰
</label>

<label class="checkbox pull-left ">
<input type="checkbox" name="product_categories" value="Electronics &amp; Gadgets"> 电子产品与配件
</label>

<label class="checkbox pull-left ">
<input type="checkbox" name="product_categories" value="Home &amp; Kitchen"> 家用与厨房用品
</label>

<label class="checkbox pull-left ">
<input type="checkbox" name="product_categories" value="Makeup &amp; Beauty"> 化妆品与美容用品
</label>

<label class="checkbox pull-left ">
<input type="checkbox" name="product_categories" value="Sports &amp; Outdoors"> 运动与户外
</label>

</div>
</div>
<div class="control-group">
<label class="control-label">
收入分成
<i
rel="tooltip"
title="每个订单将支付给 Wish 的百分比。 单击下面的链接了解更多详情。"
class="icon-question-sign"
></i>
</label>
<div class="controls input-append">
<input
type="text"
id="rev_share"
class="input-block-level"
value="15%"
disabled>
<span class="add-on"><i class="icon-pencil"></i></span>
</div>
<div id="rev-share-div">
<a
target="_blank"
href="http://merchantfaq.wish.com/hc/en-us/articles/204531558-What-Does-Revenue-Share-Mean-">
何为收入分成？</a>
</div>
</div>
</div>


<div id="tos-and-submit" class="form-section">
<div>
<input
id="submit-form-btn"
type="submit"
class="btn btn-large btn-primary disabled"
value="提交" />
</div>
<br>

</div>
